import React from "react";
import TrackList from "../trackList/trackList";
import "./artist.scss";

class Artist extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <TrackList
          title={this.props.recentlyPlayed_content.title}
          tracks={this.props.recentlyPlayed_content.data}
          action={this.props.action_content}
        ></TrackList>
        <TrackList
          title={this.props.tracks_content.title}
          tracks={this.props.tracks_content.data}
          action={this.props.action_content}
        ></TrackList>
      </>
    );
  }
}

export default Artist;
